import logo from './logo.svg';
import './App.css';
import About from "./pages/about";
import Main from "./pages/main";
import {
    BrowserRouter as Router, Link,
    Switch,
    useLocation,
    Route, Redirect
} from "react-router-dom";


function App() {
  return (
    <div className="App">

                      <Router>
                          <Switch>
                            <Link exact path = "/" component={Main} />
                              <Link exact path = "/about" component={About} />





                          </Switch>
                      </Router>
    </div>
  );
}

export default App;
